scripts.flamethrower_init:
var githubText = ROYGBIV.getText("github");
var controlsText = ROYGBIV.getText("controlsText");
var lastgithubTime = 0;

var vectPool = ROYGBIV.createVectorPool(10);
var gun = ROYGBIV.getObject("gun");

var psPool = ROYGBIV.getParticleSystemPool("fumePool");
var fume1 = ROYGBIV.getParticleSystemFromPool(psPool);
var fume2 = ROYGBIV.getParticleSystemFromPool(psPool);

var pointerLocked;

var tick = 0;

var fume1Config = {
  particleSystem: fume1,
  startPosition: ROYGBIV.vector(),
  startQuaternion: ROYGBIV.quaternion()
};
var fume2Config = {
  particleSystem: fume2,
  startPosition: ROYGBIV.vector(),
  startQuaternion: ROYGBIV.quaternion()
};

var psStarted = false;
var psIsBeingStopped = false;

var startFumes = function(x, y, z){
  if (psIsBeingStopped){
    return;
  }
  ROYGBIV.setVector(fume1Config.startPosition, x, y, z);
  ROYGBIV.setVector(fume2Config.startPosition, x, y, z);

  var v1 = ROYGBIV.getFromVectorPool(vectPool);
  var v2 = ROYGBIV.getFromVectorPool(vectPool);
  var v3 = ROYGBIV.getFromVectorPool(vectPool);
  var v4 = ROYGBIV.getFromVectorPool(vectPool);
  var v5 = ROYGBIV.getFromVectorPool(vectPool);
  var v6 = ROYGBIV.getFromVectorPool(vectPool);

  ROYGBIV.setVector(v1, x, y, z);
  ROYGBIV.getEndPoint(gun, '-y', v2);

  ROYGBIV.setVector(v3, v2.x - v1.x, 0, v2.z - v1.z);
  ROYGBIV.normalizeVector(v3);

  ROYGBIV.setVector(v4, 0, 1, 0);

  var ang = Math.PI / 3.5;

  ROYGBIV.applyAxisAngle(v3, v4, ang, v5);
  ROYGBIV.applyAxisAngle(v3, v4, -ang, v6);

  ROYGBIV.computeQuaternionFromVectors(v4, v5, fume1Config.startQuaternion);
  ROYGBIV.computeQuaternionFromVectors(v4, v6, fume2Config.startQuaternion);

  if (!psStarted){
    ROYGBIV.startParticleSystem(fume1Config);
    ROYGBIV.startParticleSystem(fume2Config);
  }else {
    ROYGBIV.setParticleSystemPosition(fume1, fume1Config.startPosition.x, fume1Config.startPosition.y, fume1Config.startPosition.z);
    ROYGBIV.setParticleSystemQuaternion(fume1, fume1Config.startQuaternion.x, fume1Config.startQuaternion.y, fume1Config.startQuaternion.z, fume1Config.startQuaternion.w);
    ROYGBIV.setParticleSystemPosition(fume2, fume2Config.startPosition.x, fume2Config.startPosition.y, fume2Config.startPosition.z);
    ROYGBIV.setParticleSystemQuaternion(fume2, fume2Config.startQuaternion.x, fume2Config.startQuaternion.y, fume2Config.startQuaternion.z, fume2Config.startQuaternion.w);
  }
  psStarted = true;
};

var shouldBurn = function(obj) {
  var v1 = ROYGBIV.getFromVectorPool(vectPool);
  var v2 = ROYGBIV.getFromVectorPool(vectPool);
  ROYGBIV.getCameraPosition(v1);
  ROYGBIV.getPosition(obj, v2);
  return (ROYGBIV.distance(v1, v2) <= 350);
}

var unburnAllObjects = function(){
  if (!psIsBeingStopped && psStarted){
    ROYGBIV.stopParticleSystem(fume1, 1.5);
    ROYGBIV.stopParticleSystem(fume2, 1.5);
    psIsBeingStopped = true;
    psStarted = false;
    ROYGBIV.executeDelayed(function(){
      psIsBeingStopped = false;
    }, 1000, false);
  }

  for (var i = 1; i <= 9; i ++){
    var obj = ROYGBIV.getObject("cyl" + i);
    ROYGBIV.removeAnimationFinishListener(obj, "anim1");
    if (obj.isBurning){
      obj.isBurning = false;
      if (ROYGBIV.getAnimationState(obj, "anim3") == ANIMATION_STATE_FROZEN) {
        ROYGBIV.unfreezeAnimation(obj, "anim3");
      } else {
        ROYGBIV.rewindAnimation(obj, "anim3");
      }
      if (ROYGBIV.getAnimationState(obj, "anim4") == ANIMATION_STATE_REWINDING){
        ROYGBIV.cancelAnimationRewind(obj, "anim4");
      }else {
        ROYGBIV.rewindAnimation(obj, "anim4");
      }
      ROYGBIV.onAnimationFinished(obj, "anim4", function() {
        ROYGBIV.removeAnimationFinishListener(this.attachedObject, "anim4");
        ROYGBIV.stopAnimation(this.attachedObject, "anim4");
        ROYGBIV.startAnimation(this.attachedObject, "anim1");
      });
    }
  }
}

var shootableObjects = [];
for (var i = 1; i <= 9; i ++){
  shootableObjects.push(ROYGBIV.getObject("cyl" + i));
}

var fpsControl = ROYGBIV.createFPSControl({
  playerBodyObject: ROYGBIV.getObject("playerBody"),
  initialPosition: ROYGBIV.vector(0, 130, 0),
  weaponObject1: ROYGBIV.getObject("gun"),
  requestFullScreen: false,
  speed: 450,
  crosshairName: "ch1",
  crosshairExpandSize: 8,
  shootableObjects: shootableObjects,
  onShoot: function(x, y, z, objName){
    if (!pointerLocked){
      return;
    }
    ROYGBIV.showMuzzleFlash("K819ZLBDYBA4R", 2000);

    var animState = ROYGBIV.getAnimationState(gun, "anim1");
    var fire = false;

    if (animState == ANIMATION_STATE_NOT_RUNNING){
      ROYGBIV.startAnimation(gun, "anim1");
      ROYGBIV.startAnimation(gun, "anim2");
      ROYGBIV.freezeAnimationOnFinish(gun, "anim1");
      ROYGBIV.freezeAnimationOnFinish(gun, "anim2");
    } else if (animState == ANIMATION_STATE_REWINDING){
      ROYGBIV.cancelAnimationRewind(gun, "anim1");
      ROYGBIV.cancelAnimationRewind(gun, "anim2");
    }

    tick ++;

    if (tick > 20 && objName && objName.startsWith('cyl') && shouldBurn(ROYGBIV.getObject(objName))) {

      startFumes(x, y, z);

      var obj = ROYGBIV.getObject(objName);
      if (obj.isBurning){
        return;
      }
      obj.isBurning = true;
      ROYGBIV.onAnimationFinished(obj, "anim1", function(){
        ROYGBIV.stopAnimation(obj, "anim1");
        ROYGBIV.startAnimation(obj, "anim3");
        ROYGBIV.startAnimation(obj, "anim4");
        ROYGBIV.freezeAnimationOnFinish(obj, "anim3");
        ROYGBIV.removeAnimationFinishListener(obj, "anim4");
        ROYGBIV.removeAnimationFinishListener(obj, "anim1");
      });
    } else {
      unburnAllObjects();
    }
  },
  onStoppedShooting: function(){
    ROYGBIV.hideMuzzleFlash("K819ZLBDYBA4R", 2000);
    var animState = ROYGBIV.getAnimationState(gun, "anim1");

    ROYGBIV.unfreezeAnimation(gun, "anim1");
    ROYGBIV.unfreezeAnimation(gun, "anim2");

    if (animState == ANIMATION_STATE_RUNNING){
      ROYGBIV.rewindAnimation(gun, "anim1");
      ROYGBIV.rewindAnimation(gun, "anim2");
    }

    tick = 0;

    unburnAllObjects();
  }
});

function onScene1Entry(){

  pointerLocked = ROYGBIV.isMobile();
  if (ROYGBIV.isMobile()){
    ROYGBIV.hideText(githubText);
    ROYGBIV.hideText(ROYGBIV.getText("clickToStart"));
  }else{
    ROYGBIV.startAnimation(ROYGBIV.getText("clickToStart"), "anim1");
    ROYGBIV.setScreenPointerLockChangeListener(function(isPointerLocked){
      if (ROYGBIV.getActiveSceneName() != "scene1"){
        return;
      }
      pointerLocked = isPointerLocked;
      if (isPointerLocked){
        ROYGBIV.hideText(ROYGBIV.getText("clickToStart"));
      }else{
        ROYGBIV.showText(ROYGBIV.getText("clickToStart"));
      }
    });
  }


  ROYGBIV.onTextMouseOver(githubText, function(){
    ROYGBIV.setTextColor(githubText, "#fb4934");
  });
  ROYGBIV.onTextMouseOut(githubText, function(){
    ROYGBIV.setTextColor(githubText, "#fabd2f");
  });
  ROYGBIV.onTextClick(githubText, function(){
    if (performance.now() - lastgithubTime <= 500){
      return;
    }
    lastgithubTime = performance.now();
    window.open("https://github.com/oguzeroglu/ROYGBIV", "_blank");
  });
  ROYGBIV.onTextMouseOver(controlsText, function(){
    ROYGBIV.setTextColor(controlsText, "#fb4934");
  });
  ROYGBIV.onTextMouseOut(controlsText, function(){
    ROYGBIV.setTextColor(controlsText, "#fabd2f");
  });
  ROYGBIV.onTextClick(controlsText, function(){
    if (ROYGBIV.isMobile()){
      ROYGBIV.changeScene("controlsMobile", function(){
        var separator = ROYGBIV.getText("controlsMobileSeparator");
        var move = ROYGBIV.getText("moveMobile");
        var look = ROYGBIV.getText("lookMobile");
        var jump = ROYGBIV.getText("jumpMobile");
        var back = ROYGBIV.getText("backMobile");

        ROYGBIV.setTextAlpha(move, 0);
        ROYGBIV.setTextAlpha(look, 0);
        ROYGBIV.setTextAlpha(jump, 0);
        ROYGBIV.setTextAlpha(back, 0);

        ROYGBIV.onTextClick(back, function(){
          ROYGBIV.changeScene("scene1", onScene1Entry);
        });

        ROYGBIV.startAnimation(separator, "anim1");
        ROYGBIV.onAnimationFinished(separator, "anim1", function(){
          ROYGBIV.startAnimation(move, "anim1") ;
        });
        ROYGBIV.onAnimationFinished(move, "anim1", function(){
          ROYGBIV.startAnimation(look, "anim1") ;
          ROYGBIV.setTextAlpha(move, 1);
        });
        ROYGBIV.onAnimationFinished(look, "anim1", function(){
          ROYGBIV.startAnimation(jump, "anim1") ;
          ROYGBIV.setTextAlpha(look, 1);
        });
        ROYGBIV.onAnimationFinished(jump, "anim1", function(){
          ROYGBIV.startAnimation(back, "anim1");
          ROYGBIV.setTextAlpha(jump, 1);
        });
        ROYGBIV.onAnimationFinished(back, "anim1", function(){
          ROYGBIV.setTextAlpha(back, 1);
        });
      });
    }else{
      ROYGBIV.changeScene("controlsDesktop", function(){
        var container = ROYGBIV.getContainer("container9");
        ROYGBIV.setTextColor(ROYGBIV.getText("goBackDesktop"), "#ebdbb2");
        ROYGBIV.onContainerMouseOver(container, function(){
          ROYGBIV.setTextColor(ROYGBIV.getText("goBackDesktop"), "#fb4934");
        });
        ROYGBIV.onContainerMouseOut(container, function(){
          ROYGBIV.setTextColor(ROYGBIV.getText("goBackDesktop"), "#ebdbb2");
        });
        ROYGBIV.onContainerClick(container, function(){
          ROYGBIV.changeScene("scene1", onScene1Entry);
        });
      });
    }
  });

  ROYGBIV.hide(ROYGBIV.getObject("tmp1"), true);
  ROYGBIV.hide(ROYGBIV.getObject("tmp2"), true);
  ROYGBIV.hide(ROYGBIV.getObject("tmp3"), true);
  ROYGBIV.hide(ROYGBIV.getObject("tmp4"), true);
  ROYGBIV.hide(ROYGBIV.getObject("tmp5"), true);
  ROYGBIV.hide(ROYGBIV.getObject("tmp6"), true);
  ROYGBIV.hide(ROYGBIV.getObject("tmp7"), true);
  ROYGBIV.hide(ROYGBIV.getObject("tmp8"), true);
  ROYGBIV.hide(ROYGBIV.getObject("tmp9"), true);

  ROYGBIV.setActiveControl(fpsControl);

  for (var i = 1; i <= 9; i ++){
    var obj = ROYGBIV.getObject("cyl" + i);
    ROYGBIV.startAnimation(obj, "anim1");
    ROYGBIV.startAnimation(obj, "anim2");
  }

  var door3 = ROYGBIV.getObject('door_3');
  var door4 = ROYGBIV.getObject('door_4');
  var door5 = ROYGBIV.getObject('door_5');
  var door6 = ROYGBIV.getObject('door_6');

  ROYGBIV.onAreaEnter('area1', function(exitedAreaName){
    if (exitedAreaName == 'area2'){
      return;
    }
    ROYGBIV.startAnimation(door3, 'anim1');
    ROYGBIV.startAnimation(door4, 'anim1');
    ROYGBIV.freezeAnimationOnFinish(door3, 'anim1');
    ROYGBIV.freezeAnimationOnFinish(door4, 'anim1');
  });
  ROYGBIV.onAreaExit('area2', function(enteredAreaName){
    if (enteredAreaName == 'area1'){
      return;
    }
    ROYGBIV.unfreezeAnimation(door3, 'anim1');
    ROYGBIV.unfreezeAnimation(door4, 'anim1');
  });
  ROYGBIV.onAreaExit('area1', function(enteredAreaName){
    if (enteredAreaName == 'area2'){
      return;
    }
    ROYGBIV.unfreezeAnimation(door3, 'anim1');
    ROYGBIV.unfreezeAnimation(door4, 'anim1');
  });
  ROYGBIV.onAreaEnter('area2', function(exitedAreaName){
    if (exitedAreaName == 'area1'){
      return;
    }
    ROYGBIV.startAnimation(door3, 'anim1');
    ROYGBIV.startAnimation(door4, 'anim1');
    ROYGBIV.freezeAnimationOnFinish(door3, 'anim1');
    ROYGBIV.freezeAnimationOnFinish(door4, 'anim1');
  });
  ROYGBIV.onAreaEnter('area3', function(){
    var v1 = ROYGBIV.getFromVectorPool(vectPool);
    var v2 = ROYGBIV.getFromVectorPool(vectPool);
    ROYGBIV.getCameraPosition(v1);
    ROYGBIV.mapAreaPositionToArea("area3", "area3x", v1, v2);
    ROYGBIV.setPosition(ROYGBIV.getObject("playerBody"), v2.x, v2.y, v2.z);
  });
  ROYGBIV.onAreaEnter('area4', function(exitedAreaName){
    if (exitedAreaName == 'area5'){
      return;
    }
    ROYGBIV.startAnimation(door5, 'anim1');
    ROYGBIV.startAnimation(door6, 'anim1');
    ROYGBIV.freezeAnimationOnFinish(door5, 'anim1');
    ROYGBIV.freezeAnimationOnFinish(door6, 'anim1');
  });
  ROYGBIV.onAreaEnter('area5', function(exitedAreaName){
    if (exitedAreaName == 'area4'){
      return;
    }
    ROYGBIV.startAnimation(door5, 'anim1');
    ROYGBIV.startAnimation(door6, 'anim1');
    ROYGBIV.freezeAnimationOnFinish(door5, 'anim1');
    ROYGBIV.freezeAnimationOnFinish(door6, 'anim1');
  });
  ROYGBIV.onAreaExit('area5', function(enteredAreaName){
    if (enteredAreaName == 'area4'){
      return;
    }
    ROYGBIV.unfreezeAnimation(door5, 'anim1');
    ROYGBIV.unfreezeAnimation(door6, 'anim1');
  });
  ROYGBIV.onAreaExit('area4', function(enteredAreaName){
    if (enteredAreaName == 'area5'){
      return;
    }
    ROYGBIV.unfreezeAnimation(door5, 'anim1');
    ROYGBIV.unfreezeAnimation(door6, 'anim1');
  });
  ROYGBIV.onAreaEnter('area6', function(){
    var v1 = ROYGBIV.getFromVectorPool(vectPool);
    var v2 = ROYGBIV.getFromVectorPool(vectPool);
    ROYGBIV.getCameraPosition(v1);
    ROYGBIV.mapAreaPositionToArea("area6", "area6x", v1, v2);
    ROYGBIV.setPosition(ROYGBIV.getObject("playerBody"), v2.x, v2.y, v2.z);
  });

  ROYGBIV.setTextColor(ROYGBIV.getText("controlsText"), "#ebdbb2");
}


function onSceneRotateDeviceEntry(){
  ROYGBIV.startAnimation(ROYGBIV.getText("rotateDevice"), "anim1");
}

if (!ROYGBIV.isMobile()){
  onScene1Entry();
}else{
  ROYGBIV.setScreenOrientationChangeListener(function(isOrientationLandscape){
    if (isOrientationLandscape){
      ROYGBIV.changeScene("scene1", onScene1Entry);
    }else{
      ROYGBIV.changeScene("rotateDevice", onSceneRotateDeviceEntry);
    }
  });
  if (!ROYGBIV.isOrientationLandscape()){
    ROYGBIV.changeScene("rotateDevice", onSceneRotateDeviceEntry);
  }else{
    onScene1Entry();
  }
}

ROYGBIV.stopScript("flamethrower_init");
